import React, { useState, useContext } from "react";
import { ThemeContext } from "../../context/Theme";
import LineChart from "../../components/ui/LineChart";
import Table
 from "../../components/ui/Table";
const values = [
  ["Month", ""],
  ["January", 500],
  ["February", 436],
  ["March", 846],
  ["April", 245],
  ["May", 500],
  ["June", 475],
  ["July", 500],
  ["August", 500],
  ["September", 500],
  ["October", 1250],
  ["November", 1250],
  ["December", 1250],
];

const title = "Recent"

const htitle = "Months"

const vtitle = "Admin Accounts"


export const AdminManagement = ({theme}) => {
    return (
      <div
        className={`col-span-8 overflow-hidden rounded-lg text-xs md:text-md w-64 px-8 sm:w-full`}
      >
        <div className="pt-4">
          <LineChart values={values} title={title} htitle={htitle} vtitle={vtitle} />
  
          <h1 className="text-2xl font-semibold mt-4 sm:mt-6 lg:mt-8">Account Profile</h1>
          <Table/>
        </div>
      </div>
    );
  };
